import { NavLink } from 'react-router-dom'

export const Menu = () => {
  const navLinkStyles = ({ isActive }) => {
    return {
      fontWeight: isActive ? 'bold' : 'normal',
      textDecoration: isActive ? 'none' : 'underline',
    }
  }
  return (
    <nav>
      <NavLink style={navLinkStyles} to="/groups">
        Groups
      </NavLink>
      <NavLink style={navLinkStyles} to="/channels">
        Channels
      </NavLink>
      <NavLink style={navLinkStyles} to="/message">
        Message
      </NavLink>
      <NavLink style={navLinkStyles} to="/accounts">
        Accounts
      </NavLink>
    </nav>
  )
}
